import { Component } from "react";

class Login extends Component
{
    render()
    {
        return(
            <>
            <div>
                <label htmlFor="userName">User Name</label>
                <input type="text"/>
            </div>
            <div>
                <label htmlFor="password">Password</label>
                <input type="text"/>
            </div>
            <div>
                
            </div>
            </>
        )
    }
}
export default Login
